INSERT INTO `news` (`id`, `title`, `content`, `updated`, `added`) VALUES
(1, 'Aktualizace po sobotě', 'Oficiální sobotní výsledky můžete najít aktualizované v sekci Tabulky. Také byly přidány fotky za dnešní den. Na prvních místech přenocují celky Tatranu Litovel a Velké Bystřice. Nedělní den bude ve znamení dohrávky turnaje a slavnostního vyhlášení, které se bude konat v 15:00 na hale. Těšíme se na vás!', '2015-03-10 20:14:05', '2015-03-10 21:14:05'),
(2, 'MINICUP 2014 slavnostně ukončen', 'Před malou chvílí byl slavnostně ukončen mezinárodní turnaj miniházené MINICUP 2014 v Litovli! Kategorii mladší miniházené ovládl domácí Tatran Litovel, ve starších o vzájemný zápas vyhrála Velká Bystřice! Gratulujeme, fotky z dnešního dne pro vás připravujeme a k večeru budou v kategorii Fotogalerie.', '2015-03-10 20:14:05', '2015-03-10 21:14:05'),
(5, 'Novinka', '"odkaz":[Team:default]', '2015-03-26 22:09:53', '2015-03-26 23:09:53'),
(6, 'Testovaí odkazová novinka', 'Dlouhý, sakra dlouhý text, ale najednou přichází "odkaz na super věc":[Homepage:informations]', '2015-03-26 22:14:00', '2015-03-26 23:14:00'),
(9, 'Nadpiseček', '**věc co je tučně** věc co není', '2015-03-26 22:16:05', '2015-03-26 23:16:05'),
(10, 'Seznam', '- seznam\n- nějakých kravin\n- a další', '2015-03-26 22:16:42', '2015-03-26 23:16:42'),
(11, 'Tak tohle je fakt husté', '... ->', '2015-03-26 22:17:36', '2015-03-26 23:17:36');
